import './App.css';
import Membre from './components/Membre'

const famille = {
  membre1: {
    name: 'John',
    age: 20
  },
  membre2: {
    name: 'Paul',
    age: 30
  },
  membre3: {
    name: 'George',
    age: 40
  },
  membre4: {
    name: 'Ringo',
    age: 50
  },
}


class App extends Component {
  state = {
    famille,
  }
  render() {
    return (
      <div className="App">
       <h1>React App</h1>
       <Membre name= { this.state.famille.membre1.name} />
       <Membre name='Paul' />
       <Membre name='George' />
       <Membre name='Ringo' >
       <strong>the drummer</strong>
        </Membre>
      </div>
    );
  }
}

export default App;
